  false,\n\t\"url\": null,\n\t\"notes\": \"A major goal of this planning exercise
  is to prepare the following integrated plan for resource interpretation to be sited
  at designated locations in Tetlin National Wildlife Refuge, Alaska. The funded construction
  contract calls for a visitor contact station near the Canadian Border and six wayside
  exhibits for interpretation of values related to refuge significance. These exhibits
  will primarily serve the first-time, highway traveler entering Alaska from the Yukon
  Territory in Canada. Key elements of this plan include concepts and text, with suggested
  artwork for six wayside exhibits. Draft Script for a brief audiovisual presentation
  in the contact station, not to exceed 10 minutes. Field work for the study was completed
  in February, 1987. Coordination with regional office personnel was timely and convenient.\",\n\t\"license_title\":
